import React from "react";
import { useState, useEffect } from "react";

import SearchCard from "../components/SearchCard";

const Search = (props) => {
    const queryParameters = new URLSearchParams(window.location.search)
    const search = queryParameters.get("search")
    const order = queryParameters.get("order")

    const [items, setItems] = useState([])

    useEffect(() => {
        fetch('http://127.0.0.1:8000/search?string=' + search + '&orderby=' + order)
          .then((res) => {
            return res.json();
          })
          .then((data) => {
            console.log(data);
            setItems(data);
          });
    }, [])

    var orderby;

    return(
            <main class="m-5">
                <div class="row mt-3 mb-4 text-left text-dark">
                    <div class="col-12">
                        <h3>Resultados de búsqueda para "{search}"</h3>
                    </div>
                </div>
                
                <div class="row mb-5">
                    <div class="col">
                        <form>
                            <div class="row">
                                <div class="col-lg-2 col-md-3 col-sm-4"><p class="mt-3 ms-1">Ordenar por:</p></div>

                                <div class="col-2"></div>

                                <div class="col-lg-2 col-md-3 col-sm-4"><p class="mt-3 ms-1">Filtrar por:</p></div>
                            </div>

                            <div class="row">
                                <div class="col-lg-2 col-md-3">
                                            <select class="form-select p-1 border border-1 border-dark" name="order_select">
                                                <option value="newest" onClick={orderby = "newest"}>Más nuevos</option>
                                                <option value="popular" onClick={orderby = "popular"}>Más populares</option>
                                            </select>
                                </div>

                                <div class="col-2"></div>

                                <div class="col-lg-2 col-md-3 text-end">
                                            <select class="form-select p-1 border border-1 border-dark" name="filter_select">
                                                <option value="music">Música</option>
                                                <option value="games">Juegos</option>
                                                <option value="movies">Películas</option>
                                                <option value="tv">Series TV</option>
                                                <option value="books">Libros</option>
                                                <option value="groups">Grupos</option>
                                                <option value="lists">Listas</option>
                                                <option value="discussions">Discusiones</option>
                                            </select>
                                </div>

                                <div class="col-1"></div>

                                <div class="col-lg-2 col-md-3 text-end">
                                    <a class="btn rounded bg-dark text-white mt-0 mb-3" href={'/search?search=' + search + '&orderby=' + orderby}>Buscar</a>
                                </div>
                            </div>
                        </form>
                    </div>
                </div>
                
                <div class="row mb-5">
                    <div class="col-12">
                        <div class="scrollable-card-group my-cards">
                            {items.map((item) => (
                                <SearchCard id={item._id}/>
                            ))}
                        </div>
                    </div>
                </div>

                <br/><br/><br/><br/><br/>
            </main>
    );
};

export default Search;
